INSERT INTO `note` VALUES ('3', '15', '织箩', '旅行', '<p class=\"ql-align-justify\">解我红衣织竹缕，织成箩筐卖于市。</p><p class=\"ql-align-justify\">箩筐阿婆亲手织，一条一篾出文理。</p><p class=\"ql-align-justify\">乍看篾动若行云，俄而条飞如脱矢。</p><p class=\"ql-align-justify\">织出箩来能装谷，织出筐来养鸡雉。</p><p class=\"ql-align-justify\">朝辞村头赶墟日，漫漫蜷行二十里。</p><p class=\"ql-align-justify\">腹饥且食荷包饭，暑渴但饮江河水。</p><p class=\"ql-align-justify\">一筐能换青钱几，十文初设五文止。</p><p class=\"ql-align-justify\">箩筐卖与钟鼎家，况复又遭钟鼎鄙。</p><p class=\"ql-align-justify\">夜归月下悄无人，婆娑两目杂尘滓。</p><p class=\"ql-align-justify\">我随阿婆织蜻蜓，阿婆斥我手嫩如新蕊，莫要顽皮割肤矣。</p><p class=\"ql-align-justify\">孩时不知苦为苦，一向天真常乐此。</p><p class=\"ql-align-justify\">孩时不知年岁事，直道阿婆发已靡。</p><p class=\"ql-align-justify\">胡为乎面生褶叶额生蛭，掌卧苍沟之辙履？</p><p class=\"ql-align-justify\">胡为乎三更未睡五更起，生生劳碌无穷已？</p><p class=\"ql-align-justify\">阿婆有七女，老来孕一子。</p><p class=\"ql-align-justify\">时无糟米食，满盘皆青紫。</p><p class=\"ql-align-justify\">及至儿女皆嫁娶，尘埃身骨薄如纸。</p><p class=\"ql-align-justify\">呜呼一日染风疾，儿名不识呼为姊。</p><p class=\"ql-align-justify\">观乎言行照婴孩，忽而涕泪忽而喜。</p><p class=\"ql-align-justify\">一生苦累无足说，老来但入儿乡里。</p><p class=\"ql-align-justify\">呜呼，如今儿女来反哺，再不复风风雨雨。</p><p class=\"ql-align-justify\">如今儿孙绕膝来，再不复晓月朝雾。</p><p class=\"ql-align-justify\">呜呼，吾已二十五，往事模糊尽尘土。</p><p class=\"ql-align-justify\">如今再望萧萧竹，尚作青青生园圃。</p><p class=\"ql-align-justify\">只见阿婆旧时宅，孰伐斑竹织竹缕。</p><p class=\"ql-align-justify\"><img src=\"data:image/jpeg;base64,\"></p><p><br></p>', '0', '2018年11月30', '2018年11月30', 'data:image/jpeg;base64,', null);
INSERT INTO `note` VALUES ('4', '15', '松风吟', '旅行', '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(113, 113, 113);\">那无色无形的力推动了所有的松枝却只是空白</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(113, 113, 113);\">呵&nbsp;&nbsp;你看&nbsp;&nbsp;几乎所有的松枝</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(113, 113, 113);\">都书写出墨绿酣畅的一撇&nbsp;&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(113, 113, 113);\">或一把把有凹槽的弯刀一闪</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(113, 113, 113);\">一匹马飞速跃过&nbsp;&nbsp;只看得到马尾</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(113, 113, 113);\">一群马忽闪而过&nbsp;&nbsp;也只看得到马尾</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(113, 113, 113);\">还有马蹄&nbsp;&nbsp;它们只是旋转中密集的声音</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(113, 113, 113);\">这来自天外的无色无形的力是抽象莫名的力</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(113, 113, 113);\">它没有名字&nbsp;&nbsp;只有实体</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(113, 113, 113);\">它只有精神&nbsp;&nbsp;没有肉身</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(113, 113, 113);\">它一身的蛮力找不到能够用尽的边界</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(113, 113, 113);\">它没有自我的肖像&nbsp;&nbsp;五官扁平如湖面</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(113, 113, 113);\">它狂飞乱舞的四肢掠地而过却无法现形</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(113, 113, 113);\">它在松针上&nbsp;&nbsp;找到珍贵的飘荡着的线</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(113, 113, 113);\">在松果上&nbsp;&nbsp;实现了稀有的可以立定的点</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(113, 113, 113);\">在松枝上隆起了阳刚之美的肌肉</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(113, 113, 113);\">在粗大的树干上找到了骨骼和皮肤</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(113, 113, 113);\">它喜极而泣&nbsp;&nbsp;终于获得了一具血肉完整的生命</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(113, 113, 113);\">但其实这或许只是一首歌&nbsp;&nbsp;或一首琴曲</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(113, 113, 113);\">只是一次偶然的实现或附体&nbsp;&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(113, 113, 113);\">虽说短暂&nbsp;&nbsp;但真实不虚&nbsp;&nbsp;不是梦幻</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(113, 113, 113);\">还有我&nbsp;&nbsp;一个碰巧听到这场松风吹拂而过的人</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(113, 113, 113);\">捡起地上的松针&nbsp;&nbsp;双手捧起如细小的香烛</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(113, 113, 113);\">而满山的山地松和马尾松</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(113, 113, 113);\">不少都是百岁以上的长者</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(113, 113, 113);\">它们一直都是这样站立着</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(113, 113, 113);\">像刚刚款待罢一个过境的客人</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(113, 113, 113);\">当风停下的时候&nbsp;&nbsp;它们的树枝</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(113, 113, 113);\">如拍了拍手&nbsp;&nbsp;恢复了平常习惯的样子</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(113, 113, 113);\"><span class=\"ql-cursor\">﻿</span></span><img src=\"data:image/jpeg;base64,\"></p>', '0', '2018年11月30', '2018年11月30', 'data:image/jpeg;base64,', null);

